<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
<style>
* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
    font-family: poppins;
}
body {
    background: url('Shiptime_background.png') no-repeat top center;
    background-size: cover;
    width: 100vw;
    height: 100vh;
    overflow: hidden;
}
svg {
    transform: translate(840px, 160px);
    overflow: visible!important;
}
.phone_elem {
    animation: PhonePopup forwards 0.5s linear;
    animation-delay: 0.5s;
    transform: translateY(100%);
    transition: all 0.5s ease-in;
}
@keyframes PhonePopup {
    0% {
        transform: translateY(100%);
    }
    100% {
        transform: translateY(0%);
    }
}

.card_elem_wrap {
    overflow: hidden;
}
.card_elem {
    animation: CardPopup forwards 0.5s linear;
    animation-delay: 1s;
    transform: rotateY(90deg);
    transform-origin: right;
    transform-box: fill-box;
    transition: all 0.5s ease-in;
}

@keyframes CardPopup {
    0% {
        transform: rotateY(90deg);
    }
    100% {
        transform: rotateY(0deg);
    }
}

.pop_bubble_one {
    animation: popBubble forwards 1s cubic-bezier(0.69, -0.01, 0.31, 1.64), scaleBubble 18s ease-out infinite;
    transform: translateY(800px) scale(0);
    transform-origin: center;
    transform-box: fill-box;
    transition: all 0.5s ease-in;
}
.bubble_delay0 {
    animation-delay: 0.5s, 1.5s;
}
.bubble_delay2 {
    animation: popBubble forwards 1s 1.5s cubic-bezier(0.69, -0.01, 0.31, 1.64), scaleBubble2 18s 2.5s ease-in-out infinite;
    
}
.bubble_delay4 {
    animation-delay: 2.5s, 3.5s;
}

@keyframes popBubble {
    0% {
        transform: translate(-20px, -20px) scale(0);
    }
    100% {
        transform: translate(-20px, -20px) scale(1);
    }
}

@keyframes scaleBubble {
    0% {
        transform: translate(-20px, -20px) scale(1);
    }
    50% {
        transform: translate(-20px, -20px) scale(1.4);
    }
    100% {
        transform: translate(-20px, -20px) scale(1);
    }
}
@keyframes scaleBubble2 {
    0% {
        transform: translate(-20px, -20px) scale(1);
    }
    50% {
        transform: translate(-20px, -20px) scale(1.4);
    }
    100% {
        transform: translate(-20px, -20px) scale(1);
    }
}

.fexEx_carier, .carier_services, .purolator, .canada_post {
    animation: scaleG 12s 1s linear infinite;
    transform: scale(0.65);
    transform-box: fill-box;
    transform-origin: center;
}

.carier_services {
    animation-delay: 4s;
}

.purolator {
    animation-delay: 7s;
}

.canada_post {
    animation-delay: 10s;
}

@keyframes scaleG {
    0% {
        transform: scale(0.65);
        filter: drop-shadow(0px 0px 0px rgb(0 0 0 / 0));
    }
    3% {
        filter: drop-shadow(10px 10px 10px rgb(0 0 0 / 0.1));
        stroke: #fff!important;
        transform: scale(1);
    }
    25% {
        filter: drop-shadow(10px 10px 10px rgb(0 0 0 / 0.1));
        stroke: #fff!important;
        transform: scale(1);
    }
    28% {
        filter: drop-shadow(0px 0px 0px rgb(0 0 0 / 0));
        stroke: #fff!important;
        transform: scale(0.65);
    }
    100% {
        filter: drop-shadow(0px 0px 0px rgb(0 0 0 / 0));
        stroke: #fff!important;
        transform: scale(0.65);
    }
}

 .fexEx_carier g, .carier_services g, .purolator g, .canada_post g {
    animation: scaleOpacity 12s 1s linear infinite;
    opacity: 0.5;
}

.carier_services g {
    animation-delay: 4s;
}

.purolator g {
    animation-delay: 7s;
}

.canada_post g {
    animation-delay: 10s;
}

@keyframes scaleOpacity {
    0% {
        opacity: 0.5;
    }
    3% {
        opacity: 1;
    }
    25% {
        opacity: 1;
    }
    28% {
        opacity: 0.5;
    }
    100% {
        opacity: 0.5;
    }
}

.price_animation {
    animation: finalPrice 12s linear infinite;
    animation-delay: 4s;
    transform: translateY(0px);
}

@keyframes finalPrice {
    0% {
        transform: translateY(0px);
    }
    3% {
        transform: translateY(-33px);
    }
    25% {
        transform: translateY(-33px);
    }
    28% {
        transform: translateY(-63px);
    }
    50% {
        transform: translateY(-63px);
    }
    53% {
        transform: translateY(-93px);
    }
    75% {
        transform: translateY(-93px);
    }
    78% {
        transform: translateY(-123px);
    }
    78.001% {
        opacity: 1;
    }
    78.002% {
        opacity: 0;
    }
    78.003% {
        transform: translateY(0px);
        opacity: 0;
    }
    78.004% {
        opacity: 1;   
    }
    99.999% {
        transform: translateY(0px);
    }
    100% {
        transform: translateY(0px);
    }
}
.restart_ani {
    animation: restartPrice 12s linear infinite;
    animation-delay: 4s;
    transform: translateY(0px);
}

@keyframes restartPrice {
    0% {
        transform: translateY(0px);
    }
    3% {
        opacity: 1;
        transform: translateY(-33px);
    }
    4% {
        opacity: 0;
        transform: translateY(-33px);
    }
    5% {
        opacity: 0;
        transform: translateY(33px);
    }
    6% {
        opacity: 1;
        transform: translateY(33px);
    }
    75% {
        opacity: 1;
        transform: translateY(33px);
    }
    78% {
        transform: translateY(0px);
    }
    99.998% {
        transform: translateY(0px);
    }
    100% {
        transform: translateY(0px);
    }
}

.count_animation {
    animation: countPrice 12s linear infinite;
    animation-delay: 4s;
    transform: translateY(0px);
}

@keyframes countPrice {
    0% {
        transform: translateY(0px);
    }
    3% {
        transform: translateY(-23px);
    }
    25% {
        transform: translateY(-23px);
    }
    28% {
        transform: translateY(-43px);
    }
    50% {
        transform: translateY(-43px);
    }
    53% {
        transform: translateY(-63px);
    }
    75% {
        transform: translateY(-63px);
    }
    78% {
        transform: translateY(-83px);
    }
    78.001% {
        opacity: 1;
    }
    78.002% {
        opacity: 0;
    }
    78.003% {
        transform: translateY(0px);
        opacity: 0;
    }
    78.004% {
        opacity: 1;   
    }
    99.999% {
        transform: translateY(0px);
    }
    100% {
        transform: translateY(0px);
    }
}
.restart_count {
    animation: restartCount 12s linear infinite;
    animation-delay: 4s;
    transform: translateY(0px);
}

@keyframes restartCount {
    0% {
        transform: translateY(0px);
    }
    3% {
        opacity: 1;
        transform: translateY(-23px);
    }
    4% {
        opacity: 0;
        transform: translateY(-23px);
    }
    5% {
        opacity: 0;
        transform: translateY(23px);
    }
    6% {
        opacity: 1;
        transform: translateY(23px);
    }
    75% {
        opacity: 1;
        transform: translateY(23px);
    }
    78% {
        transform: translateY(0px);
    }
    99.998% {
        transform: translateY(0px);
    }
    100% {
        transform: translateY(0px);
    }
}

.image_animation {
    animation: imageAnimation 12s linear infinite;
    animation-delay: 4s;
    transform: translateY(0px);
}

@keyframes imageAnimation {
    0% {
        transform: translateY(0px);
    }
    3% {
        transform: translateY(-110px);
    }
    25% {
        transform: translateY(-110px);
    }
    28% {
        transform: translateY(-220px);
    }
    50% {
        transform: translateY(-220px);
    }
    53% {
        transform: translateY(-330px);
    }
    75% {
        transform: translateY(-330px);
    }
    78% {
        transform: translateY(-440px);
    }
    78.001% {
        opacity: 1;
    }
    78.002% {
        opacity: 0;
    }
    78.003% {
        transform: translateY(0px);
        opacity: 0;
    }
    78.004% {
        opacity: 1;   
    }
    99.999% {
        transform: translateY(0px);
    }
    100% {
        transform: translateY(0px);
    }
}

.repeat_image {
    animation: repeatImage 12s linear infinite;
    animation-delay: 4s;
    transform: translateY(0px);
}

@keyframes repeatImage {
    0% {
        transform: translateY(0px);
    }
    3% {
        opacity: 1;
        transform: translateY(-110px);
    }
    4% {
        opacity: 0;
        transform: translateY(-110px);
    }
    5% {
        opacity: 0;
        transform: translateY(110px);
    }
    6% {
        opacity: 1;
        transform: translateY(110px);
    }
    75% {
        opacity: 1;
        transform: translateY(110px);
    }
    78% {
        transform: translateY(0px);
    }
    99.998% {
        transform: translateY(0px);
    }
    100% {
        transform: translateY(0px);
    }
}

.blink_circle {
    animation: blinkCircle 2s 4s linear infinite;
    transform: scale(0);
    transform-origin: center;
    transform-box: fill-box;
}
.blink_duration1 {
    animation-delay: 4.5s;
}
.blink_duration2 {
    animation-delay: 5.5s;
}

@keyframes blinkCircle {
    0% {
        transform: scale(0);
        opacity: 0;
    }
    10% {
        opacity: 1;
    }
    20% {
        transform: scale(1.5);
        opacity: 0;
    }
    100% {
        transform: scale(1.5);
        opacity: 0;
    }
}

.dicount_star_element {
    animation: blastDiscount 5s 1.4s linear infinite;
    transform: translate(60px, 810px);
    transform-origin: center;
    transform-box: fill-box;
}

.animation_delay1, .animation_delay3, .animation_delay6 {
    animation: blastDiscount1 4s 1.7s linear infinite;
}
.animation_delay2 {
    animation-delay: 2.2s;
}
.animation_delay3 {
    animation-delay: 3.2s;
}
.animation_delay5 {
    animation-delay: 4.4s;
}

.animation_delay4 {
    animation-delay: 3.3s;
}

@keyframes blastDiscount {
    0% {
        transform: translate(50px, 810px) scale(0.8);
    }
    60% {
        transform: translate(50px, 300px) scale(1);
        opacity: 1;
    }
    70% {
        opacity: 0;
    }
    100% {
        transform: translate(50px, 0px) scale(1.2);
        opacity: 0;
    }
}

@keyframes blastDiscount1 {
    0% {
        transform: translate(350px, 475px) scale(0.8);
    }
    50% {
        transform: translate(350px, 200px) scale(1);
        opacity: 1;
    }
    70% {
        opacity: 0;
    }
    100% {
        transform: translate(350px, 0px) scale(1.2);
        opacity: 0;
    }
}


.wing_delay1 {
    animation: wing_delay1 4s 1.5s linear infinite;
    opacity: 0;
}
.wing_delay2 {
    animation: wing_delay2 4s 1.5s linear infinite;
    opacity: 0;
}


@keyframes wing_delay1 {
    0% {
        opacity: 0;
    }
    10% {
        opacity: 1;
    }
    80% {
        opacity: 1;
    }
    100% {
        opacity: 0;
    }
}
@keyframes wing_delay2 {
    0% {
        opacity: 0;
    }
    40% {
        opacity: 1;
    }
    60% {
        opacity: 1;
    }
    100% {
        opacity: 0;
    }
}

.location_shiptime {
    animation: rotateAnimation 8s 1s cubic-bezier(0.4, 0, 1, 1) infinite;
    transform-box: fill-box;
    transform-origin: bottom;
    opacity: 0;
    transition: all 15s ease-in;
}
.location_delay1 {
    animation-delay: 1.3s;
}
.location_delay2 {
    animation-delay: 1.4s;
}
.location_delay3 {
    animation-delay: 1.5s;
}
.location_delay4 {
    animation-delay: 1.6s;
}
.location_delay5 {
    animation-delay: 1.7s;
}

@keyframes rotateAnimation {
    0% {
        transform: scale(0);
        opacity: 0;
    }
    5% {
        transform: scale(1.2);
        opacity: 1;
    }
    10% {
        transform: scale(1);
    }
    55% {
        transform: scale(1);
        opacity: 1;
    }
    58% {
        transform: scale(1.2);
    }
    60% {
        transform: scale(0);
    }
    100% {
        transform: scale(0);
        opacity: 0;
    }
}

.background_map {
    animation: bgMap 8s 1s ease-in-out infinite;
    transform: translateX(0%);
}

@keyframes bgMap {
    0% {
        transform: translateX(0%);
    }
    80% {
        transform: translateX(0%);
    }
    99.9999% {
        transform: translateX(116.2%);
    }
    100% {
        transform: translateX(0%);
    }
}

.front_map {
    animation: frontMap 8s 1s ease-in-out infinite;
    transform: translateX(117%);
}

@keyframes frontMap {
    0% {
        transform: translateX(117%);
    }
    80.5% {
        transform: translateX(117%);
    }
    99.9999% {
        transform: translateX(0%);
    }
    100% {
        transform: translateX(117%);
    }
}

.stroke_animation {
    animation: rotateStrokAni 8s 1s linear infinite;
    transform: translate(0px, 0px) rotateY(0deg);
    stroke-dasharray: 0 100% 0 100%;
    opacity: 0;
}


@keyframes rotateStrokAni {
    0% {
        stroke-dasharray: 0 100% 0 100%;
        opacity: 0;
    }
    5% {
        opacity: 0;
    }
    7% {
        opacity: 1;
    }
    38% {
        stroke-dasharray:  0 5 90% 0;
        opacity: 1;
    }
    51.999% {
        stroke-dasharray:  0 0 0 90%;
        opacity: 1;
    }
    52% {
        opacity: 0;
    }
}

.truck_animation {
    animation: truckAnimation 3s 2s cubic-bezier(0.63,-0.21, 0.46, 1.17) infinite;
}

@keyframes truckAnimation {
    0% {
        transform: translateX(0px);
    }
    8% {
        transform: translateX(-10px);
    }
    30% {
        transform: translateX(30px);
        opacity: 1;
    }
    30.0001% {
        opacity: 0;
    }
    30.0002% {
        transform: translateX(-30px);
        opacity: 0;
    }
    30.0003% {
        opacity: 1;
    }
    55% {
        transform: translateX(0px);
    }
    100% {
        transform: translateX(0px);
    }
}

</style>
